import React from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import logo from './logo.svg';
import Prijava from "./components/Prijava";
import './App.css';

function App() {
  return (
    <RecoveryProvider>
      <Router>
        <Switch>
          <Route exact path="/" component={Prijava}></Route>
        </Switch>
      </Router>
    </RecoveryProvider>
    );
}

export default App;
